import React from "react";
import { Container, Table } from "react-bootstrap";
import "../../Assets/CitasMedico.css";
import { data } from "../../data/dataCitasMedico";
import { Link } from "react-router-dom";

let datos = JSON.parse(JSON.stringify(data));

const Fecha = (props) => {
  return (
    <table id="citas">
      <tr>
        <th scope="col">Nombre</th>
        <th scope="col">Hora</th>
        <th scope="col">Fecha</th>
        <th scope="col">Llamar</th>
      </tr>
      {datos.map((data, index) => (
        <tr>
          <td>{props.paciente}</td>
          <td>{props.fecha}</td>
          <td>{props.hora}</td>
          <td>
            <Link className="btn btn-success" to="codigo">
              Llamar paciente
            </Link>
          </td>
        </tr>
      ))}
    </table>
  );
};

const Fechas = (props) => {
  return (
    <div className="container">
      <div className="row">
        <table id="citas">
          <tr>
            <th scope="col">Nombre</th>
            <th scope="col">Hora</th>
            <th scope="col">Fecha</th>
            <th scope="col">Llamar</th>
          </tr>
          {datos.map((data, index) => (
            <tr>
              <td>{props.paciente}</td>
              <td>{props.fecha}</td>
              <td>{props.hora}</td>
              <td>
                <Link className="btn btn-success" to="codigo">
                  Llamar paciente
                </Link>
              </td>
            </tr>
          ))}
        </table>
        <Fecha
          key={idx}
          paciente={arrDatos[0]}
          hora={arrDatos[1]}
          fecha={arrDatos[2]}
        />
      </div>
    </div>
  );
};

export const CitasMedico = () => {
  return datos.map((arrDatos, idx) => {
    return (
      <Fechas
        key={idx}
        paciente={arrDatos[0]}
        hora={arrDatos[1]}
        fecha={arrDatos[2]}
      />
    );
  });
};
export default CitasMedico;
